import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
import data from './data'
console.log(data[0]);

ReactDOM.render(
  <React.StrictMode>
    <Card  imgsrc={data[0].imgsrc}
    title={data[0]}
    name={data[0].name}/>

  </React.StrictMode>,
  document.getElementById('root')
);

